body:
1. Файл config.h - настройки сборки, заготовка содержит путь к логу и настройку лога.


2. Подключение библиотек.

#include "log/console.h"
#include "getapi/Memory.h"
#include "getapi/GetApi.h"
#include "getapi/Strings.h"
#include "obfuscated/strobfuscator.h"
#include "config.h"



int main()
{
	InitializeAPI();
	Console_Open((char*)LOG_PATH);//для лога

	int r = 5;
	debug_printf("test msg: %d", r);
	debug_printfw(L"test msg: %d", r);


	char *s = _STR("string 1"); // "string 1" будет обфусцирована, в exe-файле, в строках, не видна.


	return 0;
}	


3. Настройка проекта.
Лоадер должен выдавать 8 вариантов. Сборка в виде exe и dll. 
Release_logged x64
Release_nologs x64
Release_logged x86
Release_nologs x86
Release_dll_logged x64
Release_dll_nologs x64
Release_dll_logged x86
Release_dll_nologs x86

Debug - на свое усмотрение.

В конфигурациях Release_nologs, Release_dll_nologs, чтобы отключить вывод в лог, определить RELEASE_NOLOG, debug_printf разрешаются в пусто.
В конфигурациях *_dll_* определить LOADER_DLL.

В код включить следующее.
#ifdef LOADER_DLL
#ifdef __cplusplus
extern "C"
{
#endif
__declspec(dllexport) int StartFunc();
#ifdef __cplusplus
}
#endif

#endif

#ifdef LOADER_DLL
__declspec(dllexport) int StartFunc()
#else
int main()
#endif
{
  return 0;
}

в конце getapi.h есть определения функций, которые надо использовать, например,
char b[64];
plstrcpyA(b, _STR("string"));

Вот тут наверное антивирус портиться кодировка:
hr = PtrProduct->get_ProductName(&PtrVal);
        if (FAILED(hr)) {debug_printf(L"get_ProductName failed with error: 0x%d\n", hr);
            goto exit;
        }
        debug_printf(L"\nProduct name: %s\n", PtrVal);
        int ilen = lstrlenW(PtrVal);
        UNICODE2char(PtrVal, productName, ilen);
        productName[ilen] = 0;

Пример:
_Success_(return != 0)
BOOL wideCharToUtf8(_In_reads_(wcsSize) PCWSTR wcs, _In_ int wcsSize, _Outptr_ PSTR* utf8Str,
    _Out_ int* utf8StrSize)
{
    int cb = WideCharToMultiByte(CP_UTF8, 0, wcs, wcsSize, NULL, 0, NULL, NULL);
    PSTR result = (PSTR)HeapAlloc(GetProcessHeap(), 0, cb);
    if (!result)
        return FALSE;

    cb = WideCharToMultiByte(CP_UTF8, 0, wcs, wcsSize, result, cb, NULL, NULL);

    *utf8Str = result;
    *utf8StrSize = cb;
    return TRUE;
}
